// Hdr.js
import React from 'react';
import Button from './Button'; // Assuming you have a Button component
import './Hdr.css';

const Hdr = ({ onAddUserClick }) => {
  const imageUrl1 = 'https://example.com/path/to/image1.jpg'; // Replace with your absolute image URL
  const imageUrl2 = 'https://example.com/path/to/image2.jpg'; // Replace with another image URL

  const hdrStyle = {
    position: 'relative',
    overflow: 'hidden',
  };

  const imageStyle1 = {
    position: 'absolute',
    top: '20px',
    left: '20px',
    width: '100px',
    height: '100px',
    objectFit: 'cover',
    zIndex: 1,
  };

  const imageStyle2 = {
    position: 'absolute',
    top: '50px',
    left: '50px',
    width: '150px',
    height: '150px',
    objectFit: 'cover',
    zIndex: 1,
  };

  const signInButtonStyle = {
    position: 'absolute',
    top: 0,
    right: 0,
    padding: '20px', // Adjust the padding as needed
  };

  return (
    <div className="hdr" style={hdrStyle}>
      <img src={imageUrl1} alt="Image 1" style={imageStyle1} />
      <img src={imageUrl2} alt="Image 2" style={imageStyle2} />
      <h1>cinema review</h1>
      <div className="button-container">
        <Button onClick={onAddUserClick}>Write a review!</Button>
        <Button onClick={onAddUserClick} style={signInButtonStyle}>
          Sign In
        </Button>
      </div>
    </div>
  );
};

export default Hdr;
